<li>Klik <strong>Kartu Debit/Kredit</strong> pada kolom <strong>METODE PEMBAYARAN</strong> di laman proses <strong>PENGIRIMAN &amp; PEMBAYARAN</strong>, lalu pilih <strong>Mandiri Debit Online</strong>.</li>
<li>Masukkan nomor BIN (6 digit awal dari nomor depan kartu Mandiri Debit Online Anda).</li>
<li>Periksa kembali <strong>RINGKASAN PEMESANAN</strong> Anda.</li>
<li>Beri tanda <em>checklist</em> apabila Anda sudah membaca dan menyetujui syarat dan ketentuan Blibli.com.</li>
<li>Klik <strong>Bayar Sekarang</strong> untuk melanjutkan proses pembayaran (Halaman akan berpindah ke laman pembayaran kartu Mandiri Debit Online).
<ul>
<li>Ketik Req &lt; spasi &gt; VCN &lt; spasi &gt; (Nominal) melalui SMS Banking BNI kirim ke 3346</li>
Atau
<li>Tekan *141#23# pilih angka 6 (E COMMERCE) -&gt; 1 (e Payment) -&gt; 1 (BNI VCN)</li>
<li>Tarif SMS sesuai provider, tarif OTP Rp500,-</li>
<li>Anda akan menerima SMS balasan dari BNI, berisi perintah mengetik 2 digit secara acak sesuai nomor PIN Anda</li>
<li>Anda akan mendapatkan notifikasi status request BNI Debit Online melalui SMS Banking berupa Nomor Kartu Virtual (VCN) yang terdiri dari 16 Digit, Valid thru (bulan/tahun), dan 3 Digit nomor CVC2</li>
</ul>
</li>
<li>Lengkapi detail informasi kartu Mandiri Debit Online Anda sesuai dengan form yang tersedia (pada kolom CVV/ CVC2, masukkan 3 digit nomor yang tertera pada bagian belakang kartu Mandiri Debit Online Anda), klik <strong>SUBMIT</strong>.</li>
<li>Setelah itu akan muncul permintaan kode OTP <em>(One Time Password)</em> untuk <em>3D Secure Dynamic Pin</em>. Kode OTP akan dikirimkan oleh pihak Bank Mandiri melalui SMS.</li>
<li>Proses pembayaran telah selesai. Anda akan diarahkan ke laman <strong><strong>TERIMA KASIH</strong></strong>.</li>
</ol></div>
